%[text] ## Create views by aggregation with charts.
%[text] In the [previous blog post](https://blogs.mathworks.com/graphics-and-apps/2024/07/31/creating-a-flight-tracking-dashboard-part-2-developing-an-aircraft-chart/), we saw how to encapsulate a related set of graphics objects and functions as a custom chart. We can use charts as standalone objects within scripts and functions, or embed them in a larger application. In this example, we'll create two views by aggregation \[2\] with charts that were created previously. Specifically,
%[text] - `AircraftAttitudeView` is aggregated with the `AircraftChart`, and
%[text] - `MapView` is aggregated with the `PositionChart`. \
%[text] Creating a view via aggregation with a chart is particularly simple: the view stores a reference to the chart as one of its private properties, and instantiates the chart in its `setup` method. When the view responds to model events through its implementation of the listener callbacks, it updates the chart using the chart's public properties or methods.
%[text] ![](text:image:6e67)
%%
%[text] ## Define a class hierarchy to simplify view implementation.
%[text] We can identify two groups of views that share implementation details.
%[text] - There are six views that display a specific flight instrument (airspeed, horizon, altitude, turn, heading, and climb rate). These share the same architecture, using a box panel (`uix.BoxPanel`) from [GUI Layout Toolbox](https://www.mathworks.com/matlabcentral/fileexchange/47982-gui-layout-toolbox), an intermediate [grid layout](https://www.mathworks.com/help/matlab/ref/uigridlayout.html) and [panel](https://www.mathworks.com/help/matlab/ref/uipanel.html), and a [flight instrument](https://www.mathworks.com/help/aerotbx/flight-instruments.html) component from [Aerospace Toolbox](https://www.mathworks.com/products/aerospace-toolbox.html).
%[text] - There are four views that use a text-based display to show the current value of a variable (time, latitude, longitude, and yaw). These views use the same graphics objects (an [axes](https://www.mathworks.com/help/matlab/ref/axes.html), [rectangle](https://www.mathworks.com/help/matlab/ref/rectangle.html), and [text](https://www.mathworks.com/help/matlab/ref/text.html) box). \
%[text] To share common code between multiple classes, we create a [class hierarchy](https://www.mathworks.com/help/matlab/matlab_oop/hierarchies-of-classes-concepts.html). This enables future modifications to the shared code to be made in a single location, rather than having to make the same change across a number of files.
%[text] We define a superclass `FlightInstrumentView` that contains the shared graphics objects and an abstract property `Instrument`.
